      SELECT DISTINCT 52 - - COUNT ( col0 ) + COUNT ( * ) FROM tab2 (FORMAT parquet) cor0 WHERE NOT ( + 62 ) BETWEEN NULL AND + col0 * + - col2;
  - name: tab2

outputs:
  - name: q1150.out
    data: |
      58
